import { useParams } from "react-router"

const EditMovie = () => {

    const {id} = useParams()
    const movies = useSelector(state => state.movies)
    const [movie] = movies.find(movie => movie._id === id)

    return (
        <>
            <h2>Edit Movie</h2>
            <p>{id}</p>
        </>
    )
}

export default EditMovie
